alue;                                         // engine torque\nconst r = wheels.value;                                           // radius of wheels\nconst Ca = aerodynamic_drag.value;                                // aerodynamic drag coefficient\nconst Fd = [-Tor/r, Tor/r];                                       // range of engine force\nconst v = [start_velocity.value / 3.6, end_velocity.value / 3.6]; // range of velocity for car\nconst v_w = wind.value;                                           // wind velocity (&gt;0 opposite to driving direction)\nconst angle = angle_verify();                                     // road slope in radians\n\nconst T = {'i':Math.pow(10, t_i.value), 'p':Math.pow(10, t_p.value)};\nconst N_start = stf.value / T['p'];\nconst N = etf_verify() / T['p'];\n\nlet vs = [v[0]];\nt_all.length = 0;\nv_all.length = 0;\na_all.length = 0;\nif (stf.value === 0) {\n    v_all.push(v[0] * 3.6);\n    t_all.push(0);\n    a_all.push(0);\n}\nlet e = [0.0, 0.0];\nlet de = [0.0, 0.0];\nlet u = [-2, 2];\nlet u_curr = 0.0;\nconst kp = Math.pow(10, k_p.value);\n\nfunction etf_verify() {\n    if (etf.value - stf.value &lt; 20)\n        etf.value = stf.value + 20;\n    return etf.value;\n}\n\nfunction angle_verify() {\n    let max_val = clamp(Math.asin((Fd[1] - fa_calc(end_velocity.value)) / (M * 9.81)) * 180 / Math.PI, 0, 20);\n    if (isNaN(max_val))\n        max_val = 0;\n    if(Fd[1] &lt;= M * 9.81 * Math.sin(ang.value * Math.PI / 180) + fa_calc(end_velocity.value))\n        ang.value = max_val;\n    ang.end = max_val;\n    ang.title = \"Angle (degrees, max=\" + Math.round(max_val * 100) / 100 + \")\";\n    return ang.value * Math.PI / 180;\n}\n\nfunction clamp(val, mn, mx) {\n    if(val &lt; mn)\n        return mn;\n    if(val &gt; mx)\n        return mx;\n    return val;\n}\n\nfunction e_calc(v_curr) {\n    e[0] = e[1];\n    e[1] = v[1] - v_curr;\n    de[0] = de[1];\n    de[1] = e[1] - e[0];\n}\n\nfunction du_calc() { return kp * (de[1] + (T['p'] / T['i']) * e[1]); }\n\nfunction fg_calc() { return M * 9.81 * Math.sin(angle); }\n\nfunction fa_calc(v_curr) {\n    return Math.sign(v_curr - v_w) * Ca * (v_curr - v_w) ** 2;\n}\n\nfunction fd_calc() {\n    u_curr = clamp(u_curr, u[0], u[1]);\n    return (u_curr * (Fd[1] - Fd[0])) / (u[1] - u[0]);\n}\n\nfunction v_calc(v_num) {\n    let v_curr = vs[v_num - 1];\n    e_calc(v_curr);\n    u_curr += du_calc();\n    return ((fd_calc() - (fg_calc() + fa_calc(v_curr))) / M) * T['p'] + v_curr;\n}\n\nfor (let i = 1; i &lt; N; i++) {\n    let v_ = v_calc(i);\n    vs.push(v_);\n    if (i &gt;= N_start) {\n        t_all.push(i * T['p']);\n        v_all.push(v_ * 3.6);\n        a_all.push((vs[i] - vs[i - 1]) / T['p']);\n    }\n}\nsource.change.emit();"},"id":"1196","type":"CustomJS"},{"attributes":{"bar_color":"#FB4D3D","end":200,"format":"0[.]00","js_property_callbacks":{"change:value":[{"id":"1208"}]},"start":0,"title":"Start Velocity (km/h)","value":0},"id":"1197","type":"Slider"},{"attributes":{"bar_color":"#4377B1","end":3,"format":"0[.]00","js_property_callbacks":{"change:value":[{"id":"1196"}]},"start":-3,"step":0.1,"title":"Ti (10^X)","value":-1},"id":"1195","type":"Slider"},{"attributes":{"bar_color":"#FB4D3D","end":3000,"format":"0[.]00","js_property_callbacks":{"change:value":[{"id":"1208"}]},"start":1500,"step":10,"title":"Mass of the Car (kg)","value":1500},"id":"1200","type":"Slider"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","tools":[{"id":"1122"},{"id":"1123"},{"id":"1124"},{"id":"1125"},{"id":"1126"}]},"id":"1128","type":"Toolbar"},{"attributes":{},"id":"1026","type":"SaveTool"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","top_units":"screen"},"id":"1027","type":"BoxAnnotation"},{"attributes":{"bar_color":"#FB4D3D","end"
